import React, { useState } from "react";
import '../../App.css';
import '../createLotPopup/createLotPopup.css';
import helpIcon from '../../assets/images/help-icon.svg';
import CustomBtn from "../customBtn/customBtn";
import ProgressBar from "../progressBar/progressBar";

const SelectionPopup = (props) => {

    const [progressStep, setProgressStep] = useState(1);

    return(
        <div className="popup-outer-container">
            <div className="popup-inner-container">
                <div className="display_flex space_between flex_align_center">
                    <p className="title-text no_bottom_margin">
                        Multi-user Lot
                    </p>                
                    <img className="help-icon" src={helpIcon}/>
                </div>
                <br />
                <ProgressBar />
                <p className="title-text">
                    Multi-user Lot
                </p>
                <p className="subtext">
                    In this lot multiple people will bet against you. 
                    The condition for the lot to start is both sides should have equal funds.
                </p>
                <CustomBtn 
                label="Next"
                onClick={props.onCreateClick}
                />
            </div>            
        </div>
    );
}

export default SelectionPopup;
